import Bike from "./bike";
import Showroom from "./showroom";
function car(props){

    const { worker }=props; 
     const brand = "Farraricar";
     const text=`I Am A ${brand}${worker}`

    return (
        <>
        <h2>{text}</h2> 
        <Bike/>
        <Showroom/>
        </>
    );
    
}

export default car;
